syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";

// Version: 5.4
message AnnounceData {
	string count_down_text = 14;
	string dungeon_confirm_text = 9;
	string center_system_text = 6;
	uint32 end_time = 2;
	uint32 center_system_frequency = 8;
	uint32 begin_time = 7;
	bool is_center_system_last5_every_minutes = 13;
	uint32 config_id = 12;
	uint32 count_down_frequency = 4;
}